function getData(r){return new Promise((s,t)=>{switch(r){case"students":$.ajax({url:"data/latvian_students.json",dataType:"json",success:function(a){a={labels:a.fields.slice(12,17).map(a=>a.id),data:a.records[29].slice(12,17)};console.log(r," data:",a),s(a)},error:function(a,e,o){console.error("Error loading student data:",o),t(o)}});break;case"students-d3":$.ajax({url:"data/latvian_students.json",dataType:"json",success:function(a){var e=a.fields.slice(12,17).map(a=>a.id);let o=a.records[29].slice(12,17);a=e.map((a,e)=>({label:a,value:o[e]}));console.log(r," data:",a),s(a)},error:function(a,e,o){console.error("Error loading student data:",o),t(o)}});break;case"NMP":console.log("Fetching NPM data..."),$.ajax({url:"data/NMP_Novadi.json",dataType:"json",success:function(a){a={labels:a.records.map(a=>a[1]),data:a.records.map(a=>a[4])};console.log(r," data:",a),s(a)},error:function(a,e,o){console.error("Error loading NPM data:",o),t(o)}});break;default:console.log("Invalid request"),t("Invalid data type")}})}export{getData};